        const int MOD = 1000000007;
        static public int[] conv(int[] x, int[] y, int n)
        {
            var ret = new int[n + 1];
            for (int i = 0; i <= n; i++)
            {
                if (x[i] == 0) continue;
                for (int j = 0; i + j <= n; j++)
                {
                    ret[i + j] = (int)((ret[i + j] + 1L * x[i] * y[j]) % MOD);
                }
            }
            return ret;
        }
        static public int[] pow(int[] x, long n, int m)
        {
            var ret = new int[m + 1];
            ret[0] = 1;
            for (;;)
            {
                if ((n & 1) == 1)
                    ret = conv(ret, x, m);
                n >>= 1;
                if (n == 0) break;
                x = conv(x, x, m);
            }
            return ret;
        }
